import ListGroup from "react-bootstrap/ListGroup";

const MisList = ({ mis, solInsts }) => {
  return (
    <>
      <ListGroup as="ul">
        {mis.length === 0
          ? "No"
          : mis.map((mis) => (
              <ListGroup.Item as="li" key={mis.id} bold>
                Name: {mis.name} <br />
                Solidarity Institution:
                {solInsts.map((inst) =>
                  inst.id === mis.solInstId ? " " + inst.name : ""
                )}
                <br />
                Email: {mis.email} <br />
                Contact: {mis.contact} <br />
              </ListGroup.Item>
            ))}
      </ListGroup>
    </>
  );
};

export default MisList;
